import React from 'react';
import './styles.css';
import Topic from './topic';

export default function Topicos({topics}) {
  return (
    <section className="bg-[#111827]">
      <div className=" w-[100%] h-[100%] flex z-1 items-center py-[46px] sm:px-[100px] px-[20px] flex-col ">
        <div className="w-[100%] flex max-w-7xl items-center  flex-col conteee ">
          <div className="gap-[32px] w-[100%] flex  my-[32px] flex-col-reverse sm:flex-col px-[15px] ">
            {topics.map((card, index) => (
              <Topic key={index} title={card.title} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}
